import React from 'react'

export default function CreateProducts() {
    return (
        <div>
            <select name="type" id="type" onChange={getType}> 
                <option value="ac" id="ac">AC</option>
                <option value="stereo" id="stereo">Stereo</option>
                <option value="heater" id="heater">Heater</option>
                <option value="light" id="light">Light</option>
            </select>
        </div>
    )
}
